package com.kuaixiu.recycle.entity;import com.common.base.entity.BaseEntity;/** * . * * @CreateDate: 2018-09-29 上午09:09:53 * @version: V 1.0 */public class RecycleExternalLogin extends BaseEntity {        /**     * 序列化Id     */    private static final long serialVersionUID = 1L;    /**     * id     */    private String id ;    /**     * 用于验证用户是否一次性操作     */    private String token ;    /**     * 登录手机号     */    private String loginMobile ;    /**     * 来源     */    private String source;    /**     * 创建时间     */    private java.util.Date createTime ;    /**     * 修改时间     */    private java.util.Date updateTime ;    /**     * get:id     */    public String getId(){        return this.id;    }    /**     * set：id     */    public void setId(String id){        this.id=id;    }    /**     * get:用于验证用户是否一次性操作     */    public String getToken(){        return this.token;    }    /**     * set：用于验证用户是否一次性操作     */    public void setToken(String token){        this.token=token;    }    /**     * get:登录手机号     */    public String getLoginMobile(){        return this.loginMobile;    }    /**     * set：登录手机号     */    public void setLoginMobile(String loginMobile){        this.loginMobile=loginMobile;    }    public String getSource() {        return source;    }    public void setSource(String source) {        this.source = source;    }    /**     * get:创建时间     */    public java.util.Date getCreateTime(){        return this.createTime;    }    /**     * set：创建时间     */    public void setCreateTime(java.util.Date createTime){        this.createTime=createTime;    }    /**     * get:修改时间     */    public java.util.Date getUpdateTime(){        return this.updateTime;    }    /**     * set：修改时间     */    public void setUpdateTime(java.util.Date updateTime){        this.updateTime=updateTime;    }}